import './App.sass';
import React from 'react';
import Particles from 'react-particles-js';

class App extends React.Component{

render(){
  return (
    <div className="App">
     <Particles
    params={{
	    "fps_limit": 60,
	    "particles": {
	        "collisions": {
	            "enable": false
	        },
	        "number": {
	            "value": 200,
	            "density": {
	                "enable": false
	            }
	        },
	        "line_linked": {
	            "enable": true,
	            "distance": 30,
	            "opacity": 0.4
	        },
	        "move": {
	            "speed": 1
	        },
	        "opacity": {
	            "anim": {
	                "enable": true,
	                "opacity_min": 0.05,
	                "speed": 1,
	                "sync": false
	            },
	            "value": 0.4
	        }
	    },
	    "polygon": {
	        "enable": true,
	        "scale": 0.5,
	        "type": "inline",
	        "move": {
	            "radius": 10
	        },
	        "url": "/small-deer.2a0425af.svg",
	        "inline": {
	            "arrangement": "equidistant"
	        },
	        "draw": {
	            "enable": true,
	            "stroke": {
	                "color": "rgba(255, 255, 255, .2)"
	            }
	        }
	    },
	    "retina_detect": false,
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "bubble"
	            }
	        },
	        "modes": {
	            "bubble": {
	                "size": 6,
	                "distance": 40
	            }
	        }
	    }
	}} />
      <div class="grid">
        <div class="module">
          <div class="module-header">

            <div class="box-label">
              <span class="file-name"> Skdev ~ Home </span>
            </div>

            <div class="box-button">
              <div class="button green"></div>
              <div class="button orange"></div>
              <div class="button red"></div>
            </div>
          </div>

          <div class="module-body">
            <div class="code-area">
              <div class="text-label">
                  Home
              </div>
              <div class="text-area">
                <code>help</code>
                <br />
                <code className="output">
                  Help - Show all commands <br />
                  Go [PAGE] - Navigate to a definate page <br />
                  Ls ([-a]) - Display all pages <br />
                  Music - Pop up Music player <br />
                  Gif - Pop up random Gif <br />
                  Contact [mail] [title] [message] - Send me an email <br />
                  Clear - Clear terminal <br />
                </code>
              </div>
             <div class="text-area">
             <code>ls</code>
             <br />
             <code className="output">
               <ul>
                 <li><span className="fetch">Home</span></li>
                 <li><span className="fetch">CV</span></li>
                 <li><span className="fetch">Projets</span></li>
                 <li><span className="fetch">Passions</span></li>
                 <li><span className="fetch">Portfolio</span></li>
                 <li><span className="fetch">Contact</span></li>
               </ul>
             </code>
             </div>
             <div class="text-area">
                <code>cd CV</code>
                <br />
                <code className="output">""</code>
              </div>
        </div>
    </div>
  </div>
</div>
    </div>
  );
}}

export default App;
